import React, { Component } from "react";
import axios from "axios";
import "./App.css";

class App extends Component {
  state = {
    songs: []
  };

  componentWillMount() {
    axios
      .get(
        "http://ws.audioscrobbler.com/2.0/?method=geo.gettoptracks&country=india&api_key=e125487ee7c050f4e926331f871841ee&format=json"
      )
      .then(response => {
        this.setState({
          songs: response.tracks.track
        });
      });
  }
  render() {
    let songs = this.state.songs.map(song => {
      return <p>{song}</p>;
    });

    return (
      <div className="App">
        <table>
          <h1>Top Tracks from India</h1>
        </table>
      </div>
    );
  }
}

export default App;
